// src/pages/PetList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function PetList() {
  const [pets, setPets] = useState([]);

  useEffect(() => {
    api.get('/pets').then(res => setPets(res.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Pets Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
          <Link to="/pets/novo" className="btn btn-primary">+ Cadastrar Novo Pet</Link>
        </div>
      </div>

      <ul className="list-group">
        {pets.map(pet => (
          <li key={pet._id} className="list-group-item">
            <Link to={`/pets/${pet._id}`}>
              <strong>{pet.nome}</strong> – {pet.raca} ({pet.porte})
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}
